import {Component} from "react";

export class Textbox extends Component
{
	constructor(props)
	{
		super(props);
		this.state = {
			hint: this.props.hint,
			value: ""
		};
	}

	render()
	{
		return(
			<div>
				<input type={"text"} placeholder={this.state.hint} value={this.state.value} />
			</div>
		)
	}
}
